const HeaderEl = styled.header`
  box-shadow: var(--shadow);
  background-color: (--colors-ui-base);
`;

const Wrapper = styled.div``;

const Title = styled.a.attrs({
    href: '/',
})``;
s
const ModeSwitcher = styled.div``;

export const Header = () => {
    return (
    <HeaderEl>
        <Container>
            <Wrapper>
                <Title>Where is the world?</Title>
                <ModeSwitcher>
                    <IoMoon /> Light Theme
                </ModeSwitcher>
            </Wrapper>
        </Container>
    </HeaderEl>
    );
}
